    render(){
    return(
    <div className="App">
      <div className='header'>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Click Button to get Random chuck Facts
        </p>
        <button className='button-5' onClick={this.callApi}>
          FACTS
        </button>      

        < ChuckFact />

      </div>
    </div>
    )}
}

export default App;
